//创建资源
var LoadingDataHorse = "data:image/png;base64,";
var LoadingDataHorseBg = "data:image/png;base64,";
function LoadingSprite(life,callback){
	base(this,LSprite,[]);
	var s = this;
	s.progress = 0;
	s.start = Date.now();
	s.life = life==null ? 3000 : life;
	s.callback = callback;
	//添加马的背景
	var img = new Image();
	img.src = LoadingDataHorseBg;
	img.width = 320;
	img.height = 480;
	var bitmap = new LBitmap(new LBitmapData(img));
	s.horsebg = new LSprite();
	s.horsebg.addChild(bitmap);
	s.horsebg.x = 0;
	s.horsebg.y = 0;
	s.addChild(s.horsebg);
	//添加马的精灵
	s.horse = new Image();
	s.horse.src = LoadingDataHorse;
	//添加帧事件
	s.horse2 = new LSprite();
	s.addChild(s.horse2);
	s.horse2.width = 113;
	s.horse2.height = 73;
	s.horse2.x = 167.5-113/2;
	s.horse2.y = 250.5-73/2;
	s.horse2.addEventListener(LEvent.ENTER_FRAME,s.onFrame.bind(this));
	s.setProgress(s.progress);
}
LoadingSprite.prototype.onFrame = function(){
	var s = this;
	var time = Date.now()-s.start;
	if(time>=s.life && s.progress==100){
		s.horse2.removeEventListener(LEvent.ENTER_FRAME,s.onFrame);
		s.callback();
	}else{
		var rate = time>=s.life ? 1 : time/s.life;
		var w = parseInt(s.horse.width*(s.progress/100*rate)) + 1;
		LGlobal.canvas.drawImage(s.horse,0,0,w,s.horse2.height,s.horse2.x,s.horse2.y,w,s.horse2.height);
	}
}
LoadingSprite.prototype.setProgress = function(value){
	this.progress = value;
}
